import { useEffect, useMemo, useState } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/adminreservations.css";

function AdminReservations() {
    const [reservations, setReservations] = useState([]);
    const [loading, setLoading] = useState(true);
    const [errorMsg, setErrorMsg] = useState("");
    const navigate = useNavigate();
    const API = useMemo(() => process.env.REACT_APP_API_URL || "http://localhost:8080", []);

    useEffect(() => {
        const load = async () => {
            setLoading(true);
            setErrorMsg("");
            try {
                const res = await fetch(`${API}/api/reservations/all`, { credentials: "include" });

                if (res.status === 204) {
                    setReservations([]);
                    return;
                }

                const contentType = res.headers.get("content-type") || "";
                const raw = await res.text();

                if (!res.ok) {
                    throw new Error(raw || `HTTP ${res.status}`);
                }

                const data = raw
                    ? contentType.includes("application/json")
                        ? JSON.parse(raw)
                        : JSON.parse(raw) // na wypadek braku nagłówka
                    : [];

                setReservations(Array.isArray(data) ? data : []);
            } catch (e) {
                console.error("Fehler beim Abrufen der Reservierungen:", e);
                setErrorMsg(e.message || "Fehler beim Laden.");
                setReservations([]);
            } finally {
                setLoading(false);
            }
        };

        load();
    }, [API]);

    const deleteReservation = async (id) => {
        try {
            const res = await fetch(`${API}/api/reservations/${id}`, {
                method: "DELETE",
                credentials: "include",
            });
            if (!res.ok) throw new Error(`Löschen fehlgeschlagen: ${res.status}`);
            setReservations((prev) => prev.filter((r) => r.id !== id));
        } catch (err) {
            console.error("Fehler beim Löschen der Reservierung:", err);
            setErrorMsg(err.message || "Fehler beim Löschen.");
        }
    };

    const formatDateTime = (start, end) => {
        if (!start || !end) return "—";
        const s = new Date(start);
        const e = new Date(end);
        const d = s.toLocaleDateString("de-DE", { day: "2-digit", month: "2-digit", year: "numeric" });
        const t1 = s.toLocaleTimeString("de-DE", { hour: "2-digit", minute: "2-digit" });
        const t2 = e.toLocaleTimeString("de-DE", { hour: "2-digit", minute: "2-digit" });
        return `${d} – ${t1} bis ${t2} Uhr`;
    };

    return (
        <main className="admin-resv-page" aria-label="Alle Reservierungen">
            <section className="admin-resv-card">
                <div className="admin-resv-header">
                    <button onClick={() => navigate("/admin")} className="back-button" type="button">
                        ← Zurück
                    </button>
                    <h1 className="admin-resv-title">Alle Reservierungen</h1>
                </div>

                {loading ? (
                    <div className="skeleton-list" aria-busy="true" aria-live="polite">
                        <div className="skeleton-row" />
                        <div className="skeleton-row" />
                        <div className="skeleton-row" />
                    </div>
                ) : errorMsg ? (
                    <p className="error-text">{errorMsg}</p>
                ) : reservations.length === 0 ? (
                    <p className="empty-state">Keine Reservierungen gefunden.</p>
                ) : (
                    <ul className="admin-reservation-list">
                        {reservations.map((res) => {
                            const name = res.user?.fullName || res.user?.username || "–";
                            const tableNo = res.table?.tableNumber ?? "—";
                            return (
                                <li key={res.id} className="res-row">
                                    <div className="reservation-info">
                                        <div><strong>Benutzer:</strong> {name}</div>
                                        <div><strong>Tisch:</strong> {tableNo}</div>
                                        <div><strong>Zeit:</strong> {formatDateTime(res.startTime, res.endTime)}</div>
                                    </div>

                                    <button
                                        type="button"
                                        className="delete-btn"
                                        onClick={() => deleteReservation(res.id)}
                                        aria-label={`Reservierung löschen`}
                                    >
                                        Löschen
                                    </button>
                                </li>
                            );
                        })}
                    </ul>
                )}
            </section>
        </main>
    );
}

export default AdminReservations;
